import React, { useState, useEffect } from 'react';
import { 
  Users, 
  Folder, 
  Circuit, 
  TrendingUp,
  Clock,
  CheckCircle,
  AlertCircle
} from 'lucide-react';
import { userService } from '../../services/userService';
import { dossierService } from '../../services/dossierService';
import { circuitService } from '../../services/circuitService';

const Dashboard = () => {
  const [stats, setStats] = useState({
    users: 0,
    dossiers: 0,
    circuits: 0,
    dossierStats: []
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const [usersResponse, dossiersResponse, circuitsResponse] = await Promise.all([
          userService.getStats(),
          dossierService.getStats(),
          circuitService.getAll()
        ]);

        setStats({
          users: usersResponse.stats.reduce((acc, stat) => acc + stat.count, 0),
          dossiers: dossiersResponse.stats.reduce((acc, stat) => acc + stat.count, 0),
          circuits: circuitsResponse.circuits.length,
          dossierStats: dossiersResponse.stats
        });
      } catch (error) {
        console.error('Error fetching stats:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  const getStatutColor = (statut) => {
    switch (statut) {
      case 'en_attente': return 'bg-yellow-100 text-yellow-800';
      case 'en_cours': return 'bg-blue-100 text-blue-800';
      case 'traite': return 'bg-green-100 text-green-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const getStatutIcon = (statut) => {
    switch (statut) {
      case 'en_attente': return <Clock className="h-5 w-5" />;
      case 'en_cours': return <AlertCircle className="h-5 w-5" />;
      case 'traite': return <CheckCircle className="h-5 w-5" />;
      default: return null;
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h1 className="text-3xl font-bold text-gray-900">Tableau de Bord Administrateur</h1>
      </div>

      {/* Cartes de statistiques */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <Users className="h-6 w-6 text-gray-400" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">
                    Utilisateurs
                  </dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">
                      {stats.users}
                    </div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <Folder className="h-6 w-6 text-gray-400" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">
                    Dossiers
                  </dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">
                      {stats.dossiers}
                    </div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
        </div>

        <div className="bg-white overflow-hidden shadow rounded-lg">
          <div className="p-5">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <Circuit className="h-6 w-6 text-gray-400" />
              </div>
              <div className="ml-5 w-0 flex-1">
                <dl>
                  <dt className="text-sm font-medium text-gray-500 truncate">
                    Circuits
                  </dt>
                  <dd>
                    <div className="text-lg font-medium text-gray-900">
                      {stats.circuits}
                    </div>
                  </dd>
                </dl>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Statistiques des dossiers par statut */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h3 className="text-lg leading-6 font-medium text-gray-900 mb-4">
            Statistiques des Dossiers
          </h3>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            {stats.dossierStats.map((stat) => (
              <div
                key={stat.statut}
                className={`${getStatutColor(stat.statut)} rounded-lg p-4`}
              >
                <div className="flex items-center">
                  {getStatutIcon(stat.statut)}
                  <div className="ml-3">
                    <p className="text-sm font-medium capitalize">
                      {stat.statut.replace('_', ' ')}
                    </p>
                    <p className="text-2xl font-bold">{stat.count}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Actions rapides */}
      <div className="bg-white shadow rounded-lg">
        <div className="px-4 py-5 sm:p-6">
          <h3 className="text-lg leading-6 font-medium text-gray-900 mb-4">
            Actions Rapides
